import React from "react";
import "./styles/recentTrades.css";

const RecentTrades = ({ recentTrades, formatDate, onRefresh }) => {
  const handleRefresh = () => {
    // Call the onRefresh function passed from the parent component
    onRefresh();
  };

  return (
    <div className="grid-item-card-bottom-left">
      <div className="card">
        <p className="recent">Recent Trades</p>
        <button
          class="fa-solid fa-arrows-rotate"
          className="time-period-button"
          onClick={handleRefresh}
        >
          Refresh
        </button>
        <i class="fa-solid fa-arrows-rotate"></i>
      </div>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Date</th>
            <th>Symbol</th>
            <th>Stock Price</th>
            <th>Type</th>
            <th>Strike Price</th>
            <th>Entry Price</th>
            <th>Contracts</th>
            <th>Exit Price</th>
            <th>Expiration Date</th>
          </tr>
        </thead>

        <tbody>
          {recentTrades.map((trade) => (
            <tr key={trade.trade_id}>
              <td>{trade.trade_id}</td>
              <td>{formatDate(trade.trade_date)}</td>
              <td>{trade.option_symbol}</td>
              <td>{trade.underlying_stock_price}</td>
              <td>{trade.option_type}</td>
              <td>{trade.strike_price}</td>
              <td>{trade.entry_price}</td>
              <td>{trade.contracts}</td>
              <td>{trade.exit_price}</td>
              <td>{formatDate(trade.expiration_date)}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default RecentTrades;
